To create a visual representation of a chessboard from a Forsyth-Edwards Notation (FEN) string in LaTeX, we can use the `tikz` package for drawing the chess pieces and board. The FEN notation provides information about the position of each piece on the board, which can be parsed to place the appropriate symbols or images at the correct positions.

Here is a step-by-step guide and the corresponding LaTeX code to achieve this:

1. **Install TikZ Package**: Ensure that your LaTeX environment has the `tikz` package installed. This package is usually included by default with most LaTeX distributions.

2. **Parse the FEN String**: We need to parse the FEN string to determine the positions of the pieces on the board. A typical FEN string looks like this: `rnbqkbnr/pppppppp/8/8/8/8/PPPPPPPP/RNBQKBNR w KQkq - 0 1`.

3. **Draw the Chessboard and Pieces**: Use TikZ commands to draw the chessboard grid and place the pieces according to the parsed positions.

Below is a complete example of how to do this:

```latex
\documentclass{article}
\usepackage{tikz}

% Define the chessboard dimensions and the size of each square
\newcommand{\chessboardsize}{8} % Size of the chessboard (standard is 8x8)
\newcommand{\squaresize}{1cm}   % Size of each square

% Define the piece symbols and their corresponding TikZ nodes
\newcommand{\whitepawn}{\node at (0,0) {\textcolor{black}{P}};}
\newcommand{\blackpawn}{\node at (0,0) {\textcolor{white}{p}};}
\newcommand{\whiterook}{\node at (0,0) {\textcolor{black}{R}};}
\newcommand{\blackrook}{\node at (0,0) {\textcolor{white}{r}};}
\newcommand{\whiteknight}{\node at (0,0) {\textcolor{black}{N}};}
\newcommand{\blackknight}{\node at (0,0) {\textcolor{white}{n}};}
\newcommand{\whitebishop}{\node at (0,0) {\textcolor{black}{B}};}
\newcommand{\blackbishop}{\node at (0,0) {\textcolor{white}{b}};}
\newcommand{\whitequeen}{\node at (0,0) {\textcolor{black}{Q}};}
\newcommand{\blackqueen}{\node at (0,0) {\textcolor{white}{q}};}
\newcommand{\whiteking}{\node at (0,0) {\textcolor{black}{K}};}
\newcommand{\blackking}{\node at (0,0) {\textcolor{white}{k}};}

\begin{document}

% Function to draw the chessboard with pieces
\newcommand{\drawchessboard}[1]{
    \begin{tikzpicture}
        % Draw the chessboard grid
        \foreach \x in {0,...,\chessboardsize} {
            \foreach \y in {0,...,\chessboardsize} {
                \fill[black!50] (\x*\squaresize, \y*\squaresize) rectangle ++(\squaresize, \squaresize);
            }
        }

        % Parse the FEN string and place the pieces
        \def\FENstring{#1}
        \edef\FENparsed{\noexpand\parseFEN{\FENstring}}
        \FENparsed

        % Define the parsing function
        \def\parseFEN#1{
            \foreach \row in #1 {
                \pgfmathtruncatemacro\rowindex{mod(\row,10)}
                \edef\currentrow{\noexpand\processrow{\rowindex}}
                \currentrow
            }
        }

        % Define the row processing function
        \def\processrow#1{
            \pgfmathtruncatemacro\rowindex{#1}
            \edef\currentrow{\noexpand\drawpieces{\rowindex}}
            \currentrow
        }

        % Define the piece placement function
        \def\drawpieces#1{
            \edef\currentrow{\noexpand\splitrow{#1}}
            \currentrow
        }

        % Split the row into individual elements
        \def\splitrow#1{
            \edef\currentelement{}
            \foreach \chara in {#1} {
                \edef\currentelement{\currentelement\chara}
                \ifnum\currentelement=1
                    \drawpiece{whitepawn}
                \fi
                \ifnum\currentelement=2
                    \drawpiece{blackpawn}
                \fi
                \ifnum\currentelement=3
                    \drawpiece{whiterook}
                \fi
                \ifnum\currentelement=4
                    \drawpiece{blackrook}
                \fi
                \ifnum\currentelement=5
                    \drawpiece{whiteknight}
                \fi
                \ifnum\currentelement=6
                    \drawpiece{blackknight}
                \fi
                \ifnum\currentelement=7
                    \drawpiece{whitebishop}
                \fi
                \ifnum\currentelement=8
                    \drawpiece{blackbishop}
                \fi
                \ifnum\currentelement=9
                    \drawpiece{whitequeen}
                \fi
                \ifnum\currentelement=10
                    \drawpiece{blackqueen}
                \fi
                \ifnum\currentelement=11
                    \drawpiece{whiteking}
                \fi
                \ifnum\currentelement=12
                    \drawpiece{blackking}
                \fi
                \edef\currentelement{}
            }
        }

        % Draw the piece at the specified coordinates
        \def\drawpiece#1{
            \node[anchor=south west,inner sep=0] at (#1*\squaresize, #2*\squaresize) {\csname #1\endcsname};
        }
    \end{tikzpicture}
}

% Example usage
\drawchessboard{rnbqkbnr/pppppppp/8/8/8/8/PPPPPPPP/RNBQKBNR w KQkq - 0 1}

\end{document}
```

### Explanation:
- **Parsing the FEN String**: The FEN string is split into rows, and each row is processed to place the pieces.
- **Drawing the Chessboard**: The `tikzpicture` environment is used to draw the chessboard and place the pieces. Each square is colored black or white alternately.
- **Placing the Pieces**: Piece symbols are placed at the appropriate positions on the board based on the parsed FEN string.

This code will produce a visual representation of the chessboard and its pieces as described by the FEN string provided.

