Here's a Java program that implements this logic:

```java
public class PowerOfThreeChecker {

    public static boolean isPowerOfThree(int n) {
        // Check if n is less than or equal to 0.
        // A power of three must be greater than 0.
        if (n <= 0) {
            return false;
        }

        // The maximum value for a power of 3 that is still within the int range
        int maxPowerOfThree = (int) Math.pow(3, (int) (Math.log(Integer.MAX_VALUE) / Math.log(3)));

        // Check if n is exactly a power of 3
        return maxPowerOfThree % n == 0;
    }

    public static void main(String[] args) {
        // Test cases
        System.out.println(isPowerOfThree(27));  // true, because 3^3 = 27
        System.out.println(isPowerOfThree(0));   // false, 0 is not a power of any number except itself (not relevant here)
        System.out.println(isPowerOfThree(-1));  // false, negative numbers cannot be powers of 3
        System.out.println(isPowerOfThree(81));  // true, because 3^4 = 81
        System.out.println(isPowerOfThree(9));   // true, because 3^2 = 9
        System.out.println(isPowerOfThree(28));  // false, 28 is not a power of 3
        System.out.println(isPowerOfThree(243)); // true, because 3^5 = 243
    }
}
```

