#include <vector>

// Function to count occurrences of a word in a given line
int countWordInLine(const std::string& line, const std::string& word) {
    int count = 0;
    size_t pos = 0;

    while ((pos = line.find(word, pos)) != std::string::npos) {
        ++count;
        pos += word.length();
    }

    return count;
}

// Function to process the file and count the word occurrences
void countWordOccurrences(const std::string& filename, const std::string& word) {
    std::ifstream inputFile(filename);
    if (!inputFile.is_open()) {
        std::cerr << "Error opening file: " << filename << std::endl;
        return;
    }

    std::string line;
    int totalOccurrences = 0;

    // Process each line in the file
    while (std::getline(inputFile, line)) {
        totalOccurrences += countWordInLine(line, word);
    }

    inputFile.close();

    std::cout << "The word \"" << word << "\" appears " << totalOccurrences << " times in the file." << std::endl;
}

